script:
StackExchange.ready(function () {
                        $.get("/users/rank?userId=339736", function (data) {
                            $(".js-ranked-loading-spinner").remove();
                            if (data && data.indexOf("unranked") == -1) { // if data returned and is not unranked
                                $(".js-rank-badge").html(data).removeClass("d-none");
                                $(".js-rank-container").removeClass("d-none");
                            }
                        });
                    });

$(function () {
                function getPosts() {
                    $.get("/users/profile/posts/339736", {
                        postType: $(".js-post-filters > .js-post-filter-btn.is-selected[data-type]").data("type"),
                        sort: $(".js-post-sorts > .js-post-sort-btn.is-selected").data("sort")
                    }).done(function (html) {
                        $("#js-top-posts").replaceWith(html);
                    });

                }

                $(".js-post-sorts .js-post-sort-btn:not(.js-selected)").click(function () {
                    $(".js-post-sorts .js-post-sort-btn").removeClass("is-selected");
                    $(this).addClass("is-selected");
                    getPosts();
                });
                $(".js-post-filters .js-post-filter-btn:not(.js-selected)").click(function () {
                    $(".js-post-filters .js-post-filter-btn").removeClass("is-selected");
                    $(this).addClass("is-selected");
                    getPosts();
                });
            })

StackExchange.ready(function() {

                var ga3Settings = {
                    autoLink: ["stackoverflow.blog","info.stackoverflowsolutions.com","stackoverflowsolutions.com"],
                    sendTitles: true,
                    tracker: window.ga,
                    trackingCodes: [
                        'UA-108242619-1'
                    ],
                    checkDimension: 'dimension42'
                                                    };

                var customGA4Dimensions = {};


                var ga4Settings = {
                    tracker: gtag,
                    trackingCodes: [
                        'G-WCZ03SZFCQ'
                    ],
                    consentsToPerformanceCookies: "denied",
                    consentsToTargetingCookies: "denied",
                    eventParameters: customGA4Dimensions,
                    checkForAdBlock: true
                };

                StackExchange.ga.init({ GA3: ga3Settings, GA4: ga4Settings });




                StackExchange.ga.setDimension('dimension3', 'UsersShow/Show');


                StackExchange.ga.setDimension('dimension7', "1686684122.1669273077");

                StackExchange.ga.trackPageView();
            });
